import React from "react";
import Button from "@mui/material/Button";
import Stack from "@mui/material/Stack";
import TextField from "@mui/material/TextField";
import Typography from "@mui/material/Typography";

import { useTheme } from "@mui/material/styles";
import { useNavigate } from "react-router-dom";

const LoginPage = () => {
  const theme = useTheme();
  const primaryColor = theme.palette.primary.main;
  const gray2 = theme.palette.gray2.main;
  const navigate = useNavigate();

  return (
    <Stack
      spacing="60px"
      sx={{ width: "616px", margin: "0 auto", marginTop: "60px" }}
    >
      <Stack spacing={5} sx={{ textAlign: "left" }}>
        <Stack spacing={2}>
          <Typography
            variant="h5"
            component="h1"
            sx={{ color: primaryColor, fontWeight: "500" }}
          >
            Welcome Back! Cheff
          </Typography>
          <Typography paragraph={true} sx={{ color: gray2 }}>
            Please login first
          </Typography>
        </Stack>
        <Stack spacing={3}>
          <TextField type="email" label="Email" />
          <TextField type="password" label="Password" />
          <Typography paragraph={true} sx={{ color: gray2 }}>
            Forgot Password?{" "}
            <a href="#" style={{ textDecoration: "none" }} onClick={() => navigate("/resetpasswordemail")}>
              Click Here
            </a>
          </Typography>
        </Stack>
        <Button
          variant="contained"
          color="secondary"
          sx={{
            width: "140px",
            alignSelf: "flex-end",
            borderRadius: "8px",
            color: primaryColor,
            textTransform: "none",
          }}
          onClick={()=> navigate('/')}
        >
          Login
        </Button>
      </Stack>
      <Typography paragraph={true} 
      sx={{
        textAlign: 'center',
      }}>
        Dont have account?{" "}
        <a href="#" style={{ textDecoration: "none" }}>
          Sign Up here
        </a>
      </Typography>
    </Stack>
  );
};

export default LoginPage;
